import React from "react";
import { Text, Box, Container, Center } from "native-base";
import { Dimensions } from "react-native-web";

const { width, height } = Dimensions.get("window");

const App = () => {
  return (
    <Container flex={1} justifyContent="center">
      <Box w={width * 0.8} h={height * 0.8} borderWidth="1">
        <Text>FA</Text>
      </Box>
    </Container>
  );
};

export default App;
